pragma solidity ^0.8.0;

import "./LogExpMath.sol";
import "./Math.sol";
import "./SafeMath.sol";
import "./FullMath.sol";
import "./interfaces/IERC20.sol";
import "./interfaces/IUniswapV2Pair.sol";
import "./interfaces/IUniswapV2Router02.sol";
import "./interfaces/IExchange.sol";
import "./interfaces/IUsdPlusToken.sol";
import "./interfaces/IFlashLoanRecipient.sol";
import "./interfaces/IVault.sol";
import "./interfaces/IArbitrageQSUsdc.sol";

import "hardhat/console.sol";


contract ArbitrageQSUsdc is IArbitrageQSUsdc, IFlashLoanRecipient {
    using LogExpMath for uint256;
    using SafeMath for uint160;
    using SafeMath for uint256;

    address constant public balancerVault = 0xBA12222222228d8Ba445958a75a0704d566BF2C8;


    uint256 constant public changePriceBoundDenominator = 10 ** 6;

    function getFixParams(Params memory params) public view override returns (FixParams memory) {

        bool isUsdPlusLeft = IUniswapV2Pair(params.qsPool).token0() == params.usdPlus;


        Balances memory balancesCurrent = balancesQsPool(params.qsPool);
        Balances memory balancesTarget = getSampleTargets(params.qsPool);


        console.log("balancesTarget.reserve0Normalized:  ", balancesTarget.reserve0Normalized);
        console.log("balancesTarget.reserve1Normalized:  ", balancesTarget.reserve1Normalized);
        console.log("balancesCurrent.reserve0Normalized: ", balancesCurrent.reserve0Normalized);
        console.log("balancesCurrent.reserve1Normalized: ", balancesCurrent.reserve1Normalized);

        uint256 changePrice = 10 ** 18;
        changePrice = changePrice * balancesTarget.reserve0Normalized;
        changePrice = changePrice / balancesTarget.reserve1Normalized;
        changePrice = changePrice * balancesCurrent.reserve1Normalized;
        changePrice = changePrice / balancesCurrent.reserve0Normalized;

        console.log("changePrice: ", changePrice);

        if (params.lowerChangePriceBound < changePrice && changePrice < params.upperChangePriceBound) {
            return FixParams({
            skip : true,
            putUsdPlusToPool : false,
            tokens : Tokens(address(0), address(0)),
            reserves : Reserves(uint256(0), 0, 0, 0),
            usdc : address(0),
            usdPlus : address(0),
            qsRouter : address(0),
            usdcIn : 0,
            usdcOut : 0
            });
        }

        console.log("balancesTarget.reserve0:  ", balancesTarget.reserve0);
        console.log("balancesTarget.reserve1:  ", balancesTarget.reserve1);
        console.log("balancesCurrent.reserve0: ", balancesCurrent.reserve0);
        console.log("balancesCurrent.reserve1: ", balancesCurrent.reserve1);

        uint256 rCur0 = balancesCurrent.reserve0;
        uint256 rCur1 = balancesCurrent.reserve1;
        uint256 rTar0 = balancesTarget.reserve0;
        uint256 rTar1 = balancesTarget.reserve1;

        FixParams memory fixParams;

        if (isUsdPlusLeft) {
            if (changePrice < 10 ** 18) {
                // amount usd+ more than should be, so need to put usdc in pool and get usd+ from

                fixParams = FixParams({
                skip : false,
                putUsdPlusToPool : false,
                tokens : Tokens(params.usdc, params.usdPlus),
                reserves : Reserves(rCur1, rCur0, rTar1, rTar0),
                usdc : params.usdc,
                usdPlus : params.usdPlus,
                qsRouter : params.qsRouter,
                usdcIn : 0,
                usdcOut : 0
                });
            } else {
                fixParams = FixParams({
                skip : false,
                putUsdPlusToPool : true,
                tokens : Tokens(params.usdPlus, params.usdc),
                reserves : Reserves(rCur0, rCur1, rTar0, rTar1),
                usdc : params.usdc,
                usdPlus : params.usdPlus,
                qsRouter : params.qsRouter,
                usdcIn : 0,
                usdcOut : 0
                });
            }
        } else {
            if (changePrice < 10 ** 18) {
                fixParams = FixParams({
                skip : false,
                putUsdPlusToPool : true,
                tokens : Tokens(params.usdPlus, params.usdc),
                reserves : Reserves(rCur1, rCur0, rTar1, rTar0),
                usdc : params.usdc,
                usdPlus : params.usdPlus,
                qsRouter : params.qsRouter,
                usdcIn : 0,
                usdcOut : 0
                });

            } else {
                fixParams = FixParams({
                skip : false,
                putUsdPlusToPool : false,
                tokens : Tokens(params.usdc, params.usdPlus),
                reserves : Reserves(rCur0, rCur1, rTar0, rTar1),
                usdc : params.usdc,
                usdPlus : params.usdPlus,
                qsRouter : params.qsRouter,
                usdcIn : 0,
                usdcOut : 0
                });
            }
        }


        if (fixParams.putUsdPlusToPool) {
            (
            fixParams.usdcIn,
            fixParams.usdcOut
            ) = putUsdPlusToPoolGetUsdcIn(
                fixParams,
                fixParams.tokens.token0,
                fixParams.tokens.token1,
                fixParams.reserves.reserve0,
                fixParams.reserves.reserve1,
                fixParams.reserves.reserve2,
                fixParams.reserves.reserve3
            );
        } else {
            (
            fixParams.usdcIn,
            fixParams.usdcOut
            ) = pullUsdPlusFromPoolGetUsdcIn(
                fixParams,
                fixParams.tokens.token0,
                fixParams.tokens.token1,
                fixParams.reserves.reserve0,
                fixParams.reserves.reserve1,
                fixParams.reserves.reserve2,
                fixParams.reserves.reserve3
            );
        }

        return fixParams;
    }

    function balancesQsPool(address pool) public view override returns (Balances memory) {
        (uint112 reserve0, uint112 reserve1,) = IUniswapV2Pair(pool).getReserves();

        address token0Address = IUniswapV2Pair(pool).token0();
        address token1Address = IUniswapV2Pair(pool).token1();

        uint256 token0Decimals = IERC20(token0Address).decimals();
        uint256 token1Decimals = IERC20(token1Address).decimals();

        // up to e18
        uint256 reserve0Normalized = reserve0 * 10 ** (18 - token0Decimals);
        uint256 reserve1Normalized = reserve1 * 10 ** (18 - token1Decimals);

        return Balances({
        reserve0 : reserve0,
        reserve1 : reserve1,
        reserve0Normalized : reserve0Normalized,
        reserve1Normalized : reserve1Normalized
        });
    }

    function getSampleTargets(address pool) public view override returns (Balances memory) {
        address token0Address = IUniswapV2Pair(pool).token0();
        address token1Address = IUniswapV2Pair(pool).token1();

        uint256 token0Decimals = IERC20(token0Address).decimals();
        uint256 token1Decimals = IERC20(token1Address).decimals();

        uint256 reserve0 = 10 ** token0Decimals;
        uint256 reserve1 = 10 ** token1Decimals;

        return Balances({
        reserve0 : reserve0,
        reserve1 : reserve1,
        reserve0Normalized : 10 ** 18,
        reserve1Normalized : 10 ** 18
        });
    }


    function fix(Params memory params) public override {
        FixParams memory fixParams = getFixParams(params);
        _fix(fixParams);
        IERC20(params.usdc).transfer(msg.sender, IERC20(params.usdc).balanceOf(address(this)));
    }

    function _fix(FixParams memory fixParams) internal {
        if (fixParams.putUsdPlusToPool) {
            putUsdPlusToPool(
                fixParams,
                fixParams.tokens.token0,
                fixParams.tokens.token1,
                fixParams.reserves.reserve0,
                fixParams.reserves.reserve1,
                fixParams.reserves.reserve2,
                fixParams.reserves.reserve3
            );
        } else {
            pullUsdPlusFromPool(
                fixParams,
                fixParams.tokens.token0,
                fixParams.tokens.token1,
                fixParams.reserves.reserve0,
                fixParams.reserves.reserve1,
                fixParams.reserves.reserve2,
                fixParams.reserves.reserve3
            );
        }
    }

    function putUsdPlusToPoolGetUsdcIn(
        FixParams memory params,
        address token0, address token1,
        uint256 rIn0, uint256 rOut0, uint256 rIn1, uint256 rOut1
    ) internal view returns (uint256, uint256){

        uint256 aIn = calcAInForQS(rIn0, rOut0, rIn1, rOut1);
        console.log("aIn: ", aIn);

        uint256 usdcIn = calcAInForWrap(aIn);
        uint256 usdcOut = calcAOutForQS(usdcIn, rIn0, rOut0);

        return (usdcIn, usdcOut);
    }

    function pullUsdPlusFromPoolGetUsdcIn(
        FixParams memory params,
        address token0, address token1,
        uint256 rIn0, uint256 rOut0, uint256 rIn1, uint256 rOut1
    ) internal view returns (uint256, uint256){

        uint256 aIn = calcAInForQS(rIn0, rOut0, rIn1, rOut1);
        console.log("aIn: ", aIn);

        uint256 usdcIn = aIn;
        uint256 usdcOut = calcAOutOnWrap(calcAOutForQS(aIn, rIn0, rOut0));

        return (usdcIn, usdcOut);
    }

    function putUsdPlusToPool(
        FixParams memory params,
        address token0, address token1,
        uint256 rIn0, uint256 rOut0, uint256 rIn1, uint256 rOut1
    ) internal {

        uint256 aIn = calcAInForQS(rIn0, rOut0, rIn1, rOut1);
        console.log("aIn: ", aIn);

        uint256 usdcIn = calcAInForWrap(aIn);
        uint256 usdcOut = calcAOutForQS(usdcIn, rIn0, rOut0);

        uint256 E3 = 10 ** 3;
        require(aIn > E3, "aIn too low, skip actions");

        chain_WR_QS(params, token0, token1, usdcIn);
    }

    function pullUsdPlusFromPool(
        FixParams memory params,
        address token0, address token1,
        uint256 rIn0, uint256 rOut0, uint256 rIn1, uint256 rOut1
    ) internal {

        uint256 aIn = calcAInForQS(rIn0, rOut0, rIn1, rOut1);
        console.log("aIn: ", aIn);

        uint256 usdcIn = aIn;
        uint256 usdcOut = calcAOutOnWrap(calcAOutForQS(aIn, rIn0, rOut0));

        uint256 E3 = 10 ** 3;
        require(aIn > E3, "aIn too low, skip actions");

        chain_QS_UN(params, token0, token1, usdcIn);
    }

    function chain_QS_UN(
        FixParams memory params,
        address token0, address token1,
        uint256 usdcIn
    ) internal {
        uint256 token1Received = swapQS(params, token0, token1, usdcIn);
        uint256 usdcOut = unwrap(params, token1Received);
    }

    function chain_WR_QS(
        FixParams memory params,
        address token0, address token1,
        uint256 usdcIn
    ) internal {
        uint256 token0Received = wrap(params, usdcIn);
        uint256 usdcOut = swapQS(params, token0, token1, token0Received);
    }


    function calcAInForQS(
        uint256 rIn0, uint256 rOut0, uint256 rIn1, uint256 rOut1
    ) internal view returns (uint256){

        uint256 t1 = rIn0.mul(3988000).mul(rOut0).mul(rIn1).div(rOut1);
        uint256 t2 = rIn0.mul(9).mul(rIn0);
        uint256 t3 = rIn0.mul(5982);

        uint256 underSqrt = t1.add(t2).add(994009).sub(t3);
        uint256 tSqrt = sqrt(underSqrt);
        uint256 t4 = rIn0.mul(1997);
        uint256 nominator0 = uint256(997).add(tSqrt).sub(t4);
        uint256 result0 = nominator0.div(1994);

        return result0;
    }

    function calcAOutForQS(
        uint256 aIn, uint256 rIn0, uint256 rOut0
    ) internal view returns (uint256){

        uint256 _997 = 997;
        uint256 _1000 = 1000;

        uint256 amountInWithFee = aIn.mul(_997);
        uint256 numerator = amountInWithFee.mul(rOut0);
        uint256 denominator = rIn0.mul(_1000).add(amountInWithFee);
        uint256 amountOut = numerator.div(denominator);

        return amountOut;
    }

    function calcAInForWrap(uint256 aOut) internal view returns (uint256){
        return aOut.mul(10000).div(9996);
    }

    function calcAOutOnWrap(uint256 aIn) internal view returns (uint256){
        return aIn.mul(10000).div(9996);
    }

    function sqrt(uint256 x) internal view returns (uint256 y) {
        uint256 z = (x + 1) / 2;
        y = x;
        while (z < y) {
            y = z;
            z = (x / z + z) / 2;
        }
    }


    function wrap(FixParams memory params, uint256 amountIn) internal returns (uint256) {
        address exchange = IUsdPlusToken(params.usdPlus).exchange();
        IERC20(params.usdc).approve(exchange, amountIn);
        uint256 result = IExchange(exchange).buy(params.usdc, amountIn);
        return result;
    }

    function unwrap(FixParams memory params, uint256 amountIn) internal returns (uint256) {
        address exchange = IUsdPlusToken(params.usdPlus).exchange();
        IERC20(params.usdPlus).approve(exchange, amountIn);
        uint256 result = IExchange(exchange).redeem(params.usdc, amountIn);
        return result;
    }

    function swapQS(FixParams memory params, address tokenIn, address tokenOut, uint256 amountIn) internal returns (uint256) {
        IERC20(tokenIn).approve(params.qsRouter, amountIn);
        address[] memory path = new address[](2);
        path[0] = tokenIn;
        path[1] = tokenOut;
        uint256[] memory result = IUniswapV2Router02(params.qsRouter).swapExactTokensForTokens(
            amountIn,
            0,
            path,
            address(this),
            type(uint256).max
        );
        return result[1];
    }


    function fixByFlash(Params memory params) public override {
        FixParams memory fixParams = getFixParams(params);

        uint256 usdcIn = fixParams.usdcIn;
        uint256 usdcOut = fixParams.usdcOut;
        require(usdcOut >= usdcIn, "UsdcOut should be more UsdcIn");


        uint256 amountUsdcBefore = IERC20(params.usdc).balanceOf(address(this));
        console.log("amountUsdcBefore: ", amountUsdcBefore);

        bytes memory userData = abi.encode(
            fixParams,
            amountUsdcBefore,
            msg.sender // кто инициировал
        );


        IERC20[] memory tokens = new IERC20[](1);
        tokens[0] = IERC20(fixParams.usdc);
        uint256[] memory amounts = new uint256[](1);
        amounts[0] = fixParams.usdcIn;

        IVault(balancerVault).flashLoan(
            this,
            tokens,
            amounts,
            userData
        );

        uint256 amountUsdcAfter = IERC20(params.usdc).balanceOf(address(this));
        console.log("amountUsdcAfter: ", amountUsdcAfter);
        IERC20(params.usdc).transfer(msg.sender, amountUsdcAfter);

    }


    function receiveFlashLoan(
        IERC20[] memory tokens,
        uint256[] memory amounts,
        uint256[] memory feeAmounts,
        bytes memory userData
    ) external override {

        require(tokens.length == 1, "Only one token should be in flash");

        (
        FixParams memory fixParams,
        uint256 amountUsdcBefore,
        address msgSender // кто инициировал
        ) = abi.decode(
            userData,
            (FixParams, uint256, address)
        );

        require(address(tokens[0]) == fixParams.usdc, "Only USDC token should be in flash");
        require(feeAmounts[0] == 0, "Only zero fee acceptable");

        uint256 currentUsdc = IERC20(fixParams.usdc).balanceOf(address(this));
        require(currentUsdc >= fixParams.usdcIn + amountUsdcBefore, "Not enough usdc send to flash");

        _fix(fixParams);

        IERC20(fixParams.usdc).transfer(balancerVault, fixParams.usdcIn);

    }
}
